Yolk supports three different types of tags: Next-line tags ({# ... #}): These tags operate on the line following the tag. Inline tags ({< ... >}): These tags operate on everything before the tag within the same line. Block tags ({% ... %} ... {% end %}): These tags operate on everything between the tag and the corresponding {% end %} tag. You can use whichever of these you want, wherever you want. For example, all of these do the same: background_color = "#000000" # {< replace_color(colors.background) >} # {# replace_color(colors.background) #}
