In many cases, you'll want to make specific values, such as colors or paths, be set through one central source, rather than specifying them in every config file. Yolk allows you to do this (and more) by using various template functions. For example, the replace_quoted directive takes any value and replaces whatever is in quotes with the result of the expression. # {# replace_quoted(colors.background) #}
background_color = "#000000"
# {# replace_quoted(colors.foreground) #}
foreground_color = "#ffffff" After running yolk sync, yolk will replace the regex patterns with the corresponding result of the Lua expression. For example, depending on how you configured your colors in your yolk.rhai, this could turn into: # {# replace_quoted(colors.background) #}
background_color = "#282828"
# {# replace_quoted(colors.foreground) #}
foreground_color = "#ebdbb2" Yolk will refuse to evaluate directives that are non-reversible (i.e. if you replace_red ".*" with foo, as foo will no longer match that regex pattern).

