Because you too are very indecisive about your terminal colors, you now decide you want to use yolk to manage your color theme for alacritty, and any other applications that you might add later. You also decide that you want to use a different color scheme on your desktop and your laptop. To achieve this, let's first add a declaration of your color theme in your ~/.config/yolk/yolk.rhai file: // ... snip ... const themes = #{ gruvbox: #{ background: "#282828", foreground: "#ebdbb2", }, mono: #{ background: "#000000", foreground: "#ffffff", },
} export const data = #{ colors: if SYSTEM.hostname == "laptop" { themes.gruvbox } else { themes.mono }
} Beautiful! What we're doing here is setting up an exported table called data, which will store any user-data we might want to refer to in our templates in the future. We set up a field colors, which we then set to a different color scheme depending on the hostname of the system. Don't forget to export any variables you might want to reference in your template tags! Now, let's set up a template in our alacritty config file: #...
[colors.primary]
background = "#ff0000" # {< replace_color(data.colors.background) >}
foreground = "#ff0000" # {< replace_color(data.colors.foreground) >}
# ... Let's break down what's happening here: Inside the comments after the color declarations, we're using "inline template tags", as indicated by the {< ... >} syntax. These inline tags transform whatever is before them in the line. The tag calls the built-in replace_color function, which looks for a hex-code and replaces it with the value from the data.colors table. Let's try it ! Run $ yolk sync You will see that, your alacritty.toml has changed, and the colors from your yolk.rhai file have been applied, depending on your hostname.

